(4, 'ItsHot', 'Dedicated Ongoing Project with 5 Resources - 3 PHP + 2 Java Resources. Ecommerce + ERP website. Ecommerce - Magento Based. ERP - Adempier Based\r\n\r\nStatus as on 05th Dec - Phase-I tasks are more or less completed. Planning to go live this week. Next Phase will be planned afterwards.\r\n\r\n', 'Denis Stepans\r\nEmail: dstepans@yahoo.com, dstepans@itshot.com\r\nSkype: dstepans00', '2010-09-21', '2011-12-30', 'open', 36, 14, 1323073319, 1323079718),
(5, 'Tropster', 'Dedicated Ongoing Project with 1 Dedicated Resource (As on 5th Dec 2011)\r\n\r\nCurrent Status As on 05th Dec 2011 - Search Speed improvisation is going on using denormalization approach. Needs to be completed by this Christmas. Contract has already been completed. Now we are doing the current stuff on our cost. We have taken 3 weeks to implement denormalization approach for search. ', 'Dorion Hutchings\r\nEmail: drhutchings@hotmail.co.uk\r\nSkype: tropster', '2010-12-01', '2011-12-23', 'open', 36, 37, 1323074218, NULL),
(6, 'Boutiika', 'Dedicated Project with 1 Resource. \r\n\r\nStatus as on 5th Dec - Working on Rails Migration and doing Sinatra Maintenance work (if required). Planning to complete the migration by 13th Jan 2012. Further work will be planned afterwards.', 'Ruchika Kumar\r\nEmail: ruchika@boutiika.com\r\nSkype: ruchika802', '2011-06-06', '2012-01-13', 'open', 36, 1, 1323084319, NULL),
